window.bookSummaryJSON = "<p>Can you still be fated mates, after 20,000 years? I am a Queen and yet I’ve never been outside my palace. My court uses my magic to govern without me and won’t let me disobey. And now they want me to marry someone I’ve never met—a vampire whose spirit was trapped in a statue, eons ago. I know he’ll wake up dangerous and hungry, for my blood and more. But if I can tame him, and he can trust me, I just might really get to rule. Her Future Vampire Lover is a sizzling futuristic vampire romance with a fantastic HEA.</p>"; 
